// export const REQUEST_API_DATA = "REQUEST_API_DATA";
// export const RECEIVE_API_DATA = "RECEIVE_API_DATA";
export const requestApiData = (type, params) => (
  { type: (type === 'allPost') ? "REQUEST_API_DATA" : "RECEIVE_API_POST_DATA" }
);
export const receiveApiData = data => ({ type: "REQUEST_API_DATA", data });
